<script id="goraudLambertian-vs" type="x-shader/x-vertex">
attribute vec3 aVertexPosition;
attribute vec3 aVertexNormal;

uniform mat4 uMVMatrix;
uniform mat4 uPMatrix;
uniform mat4 uNMatrix;

uniform vec3 uLightDirection;   //light direction
uniform vec4 uLightDiffuse;     //light color
uniform vec4 uMaterialDiffuse;  //object color

varying vec4 vFinalColor;

void main(void) {
 //Transformed normal position
 vec3 N = normalize(vec3(uNMatrix * vec4(aVertexNormal, 1.0)));
    
 //Normalize light to calculate lambertTerm
 vec3 L = normalize(uLightDirection);
 
 //Lambert's cosine law
 float lambertTerm = dot(N,-L);
 
 //Final Color
 vec4 Id = uMaterialDiffuse * uLightDiffuse * lambertTerm;
 vFinalColor = Id;
 vFinalColor.a = 1.0;
    
  //Transformed vertex position
  gl_Position = uPMatrix * uMVMatrix * vec4(aVertexPosition, 1.0);
}
</script><script id="goraudLambertian-fs" type="x-shader/x-fragment">

 gl_FragColor = vFinalColor;
}

</script><script id='stripes-fs' type="x-shader/x-fragment">
  #ifdef GL_ES
    precision mediump float;
  #endif

  uniform vec4 uFirstColor;
  uniform vec4 uSecondColor;
  uniform bool uHorizontalStripes;
  uniform vec2 uGapSize;
  uniform float uStripeWidth;

  void main( void ) {
    vec2 res = mod(gl_FragCoord.xy, uGapSize);
    
    if(uHorizontalStripes){
      gl_FragColor = res.y < uStripeWidth ? uFirstColor : uSecondColor;
    }
    else{
      gl_FragColor = res.x < uStripeWidth ? uFirstColor : uSecondColor;
    }
  }
</script><script id='shader-vs' type="x-shader/x-vertex">

  }

</head><body ng-app="WebGLProject"><header class="container"><h1 class="title"><a href="/"></a>SGI WebGL Project</h1></header><section class="container" ng-controller="ApplicationController"><section class="row" id="scene_container"><section class="side_panels col-md-2" id="objects_management"><div class="objectsContainer"><ul class="buttons objects" sgi-add-object-to-canvas-directive=""><li class="button" id="add_pyramid">Pyramid</li><li class="button" id="add_cube">Cube</li><li class="button" id="add_sphere">Sphere</li><li class="button" id="add_cone">Cone</li><li class="button" id="add_icosphere">IcoSphere</li><li class="button" id="add_cylinder">Cylinder</li><li class="button" id="add_torus">Torus</li></ul></div></section><section class="col-md-8"><canvas id="scene_canvas" sgi-canvas-directive=""></canvas></section><section class="side_panels col-md-2" id="scene_navigation"><div class="objectsContainer"><ul class="objects_in_scene"></ul></div></section></section><section class="row" id="camera_controls"><ul class="buttons col-md-4 col-md-offset-4" id="camera_types"><li ng-class="{button: true, active: isActiveCamera(type)}" ng-click="setCameraType(type)" ng-repeat="type in cameraTypes">{(type)}</li></ul><div id="camera_zoom"></div></section><section class="row" collapse="status.isObjectControlCollapsed"><tabset class="container"><tab heading="Basic"><div class="col-md-12" id="object_controls"><section class="col-md-4" id="position_controls"><h3>Position</h3><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">X</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.xPos" type="number" /></div></div><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Y</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.yPos" type="number" /></div></div><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Z</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.zPos" type="number" /></div></div></section><section class="col-md-4" id="rotation_controls"><h3>Rotation</h3><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">X</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.xRot" type="number" /></div></div><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Y</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.yRot" type="number" /></div></div><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Z</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.zRot" type="number" /></div></div></section><section class="col-md-4" id="extras_control"><h3>Extra</h3><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Name</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.n" type="text" /></div></div><div class="form-horizontal row"><label class="col-sm-4 col-sm-offset-2 control-label">Size</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.scaleF" type="number" /></div></div></section></div></tab><tab heading="Shader"><div class="col-md-12" id="object_controls"><section class="col-md-3" id="shading_type_control"><h3>Type</h3><div class="form-horizontal row"><div class="col-sm-4 col-sm-offset-2"><div class="btn-group" dropdown="" is-open="status.isShaderDropDownOpen"><button class="btn btn-primary btn-sm dropdown-toggle" ng-disabled="disabled" type="button">{(drawable.shaderName)}</button><ul class="dropdown-menu" role="menu"><li class="shaderNames" ng-repeat="(shaderType, name) in shaderTypes"><a href="#" id="{(shaderType)}" ng-click="shaderSwitch($event)">{(name)}</a></li></ul></div></div></div></section><section class="col-md-3" id="shading_color_control"><h3>Color</h3><div class="form-horizontal row" ng-show="drawable.shaderType == &#39;stripes&#39;"><label class="col-sm-4 col-sm-offset-2 control-label" for="">Stripe 1</label><div class="col-sm-4"><button class="btn btn-primary btn-sm" colorpicker="rgba" ng-model="drawable.firstColor" type="button">Change</button></div></div><div class="form-horizontal row" ng-show="drawable.shaderType == &#39;stripes&#39;"><label class="col-sm-4 col-sm-offset-2 control-label" for="">Stripe 2</label><div class="col-sm-4"><button class="btn btn-primary btn-sm" colorpicker="rgba" ng-model="drawable.secondColor" type="button">Change</button></div></div><div class="form-horizontal row" ng-hide="drawable.shaderType == &#39;stripes&#39;"><div class="col-sm-4 col-sm-offset-2"><button class="btn btn-primary btn-sm" colorpicker="rgba" ng-model="drawable.color" type="button">Change</button></div></div></section><section class="col-md-3" id="shading_stripes_direction_control" ng-show="drawable.shaderType == &#39;stripes&#39;"><h3>Direction</h3><div class="form-horizontal row"><div class="col-sm-8 col-sm-offset-2"><div class="btn-group"><label btn-radio="true" class="btn btn-primary btn-sm" ng-model="drawable.horizontalStripes">Horizontal</label><label btn-radio="false" class="btn btn-primary btn-sm" ng-model="drawable.horizontalStripes">Vertical</label></div></div></div></section><section class="col-md-3" id="shading_stripes_size_control" ng-show="drawable.shaderType == &#39;stripes&#39;"><h3>Stripes Size</h3><div class="form-horizontal row"><label class="col-sm-4 control-label" for="">Gap Size</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.gapSize" type="number" /></div></div><div class="form-horizontal row"><label class="col-sm-4 control-label" for="">Stripe Width</label><div class="col-sm-4"><input class="form-control" ng-model="drawable.stripeWidth" type="number" /></div></div></section></div></tab></tabset></section></section><section class="container"><div class="footer"><div class="contact"><p>Rafael Simon Garcia Rodriguez</p></div><div class="contact"><p><a href="https://github.com/camonz">github.com/camonz</a><a href="https://twitter.com/camonz">twitter.com/camonz</a></p></div></div></section></body></html>
